('2014-02-23 16:41:53',	'Rodin, Brány pekla​, 1880-1917',	'Auguste Rodin, Brány pekla​, plastika (Muzeum Orsay, Paříž)Hovoří: Dr. Beth Harris a Dr. Steven ZuckerKdyž požár během Komuny v r. 1871 zničil budovu, která původně stála na místě dnešního muzea Orsay, vznikly plány, aby byla nahrazena muzeem dekorativního umění. Rodin vyhrál soutěž o návrh velkého souboru dveří pro toto muzeum. Přestože muzeum nebylo nikdy postaveno, Rodin pokračoval v práci na dveřích. Staly se jeho stálým projektem, velikým jevištěm pro jeho sochařské nápady. Je příznačné, že je plastika z této obrovské nedokončené skulptury, Brány pekla, vystavena v muzeu Orsay - dřívějším nádraží, které bylo postaveno právě místo muzea dekorativního umění. A shodou náhod bylo toto nádraží přeměněno v jedno z nejlepších světových muzeí, v Muzeum Orsay.',	'video',	'TgLTzYXg530',	'',	253,	'https://img.youtube.com/vi/TgLTzYXg530/sddefault.jpg'),
