('2014-02-23 16:41:53',	'Dechové centrum',	'Zjistěte jakým způsobem sbírá centrum dýchání informace z různých oblastí těla a tím pomáhá řídit vaše dýchání.Rishi je dětský lékař zaměřený na infekční onemocnění, který pracuje na Khan Akademii.Tyto videa neposkytují odbornou lékařskou radu a slouží pouze k informativním účelům. Nejsou určena k nahrazování odborné lékařské rady, diagnózy ani léčby. Pokud máte nějaké otázky, které se týkají zdravotního stavu, vždy vyhledejte pomoc kvalifikovaného zdravotnického personálu. Nikdy neznevažujte pokyny lékařských odborníků a neodkládejte vyhledání odborné pomoci na základě něčeho, co jste četli nebo viděli v některých z videí na Khan Akademii.',	'video',	'_BFDgTci0ck',	'',	563,	'https://img.youtube.com/vi/_BFDgTci0ck/maxresdefault.jpg'),
