('2014-09-04 15:51:36',	'Cirkusové kresby Henriho Toulouse-Lautreca',	'Cirkus byl jednou z nejlepších podívaných v pozdním 19. století v Paříži. Kombinoval mimořádné akrobatické výkony, zábavná cvičená zvířata a výstřední klauny. Tento chaotický a barevný svět přitahoval mnoho umělců, včetně Henriho de Toulouse-Lautreca, Georgese Seurata a Pierra Bonnarda. Toulouse-Lautrec byl jedním z nejnadšenějších diváků cirkusu a během 80. let 19.století byl častým návštěvníkem Cirque Fernando v sousedství Montmartre v Paříži. Zobrazoval ředitele cirkusu a klauny, tanečníky a jezdce, koně, psy a opice, komické scény a dovednosti. Máte rádi umění? Sledujte nás na Google+  http://bit.ly/gettygoogleplus',	'video',	'_Ucdj37XOHk',	'',	133,	'https://img.youtube.com/vi/_Ucdj37XOHk/hqdefault.jpg'),
